import React from "react";
import { AmplifyAuthenticator, AmplifySignUp, AmplifySignOut } from '@aws-amplify/ui-react';
import Button from '@mui/material/Button';
import styled from "styled-components"
import {Auth} from "aws-amplify";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase, faCircle, faCity, faCoffee, faUtensils } from '@fortawesome/free-solid-svg-icons';
import {} from '@fortawesome/free-brands-svg-icons';
class Search extends React.Component{


     signOut = (e) => {
        e.preventDefault();
        Auth.signOut();
        window.location.reload()
      }

    render(){


        return(
         <Topwrapper> 
           <Logo>Mapwith</Logo>
           <Nav>
              <ButtonWrapper>
               <Button variant="text" onClick={this.signOut} > Logout </Button>
              </ButtonWrapper>
           </Nav>
           <Icon>
            {/* <FontAwesomeIcon icon={faLinkedin} size="lg" mask={ faCircle } size="2x" transform="shrink-6"/> */}
           </Icon>

        </Topwrapper> 
        );
    }
}

export default Search;


const Topwrapper = styled.div`
display: flex;
position: relative;
margin-left: auto;
margin-right: auto;
`


const Logo= styled.div`

flex-grow: 1;
flex-shrink: 1;
flex-basis: 0%;
`
const Nav= styled.div`


flex-grow: 1;
flex-shrink: 1;
flex-basis: 0%;
order: -1;
`


const ButtonWrapper = styled.div`

margin-left: 0;
margin-right: 27px;

`
